import React, {useState,setState,useMemo} from 'react';
import '../App.css'
import Select from 'react-select'
import countryList from 'react-select-country-list'
function RegistrationForm() {

    const [firstName, setFirstName] = useState(null);
    const [lastName, setLastName] = useState(null);
    const [email, setEmail] = useState(null);
    const [password,setPassword] = useState(null);
    const [confirmPassword,setConfirmPassword] = useState(null);

    const [phoneNumber, setPhoneNumber] = useState(null);
    const [country, setCountry] = useState(null);
    const [userType, setUserType] = useState(null);
    const [description,setDescription] = useState(null);

    const foundation= "",gender= "",skills = ""

    const handleSelectChange = (e) => {
        setCountry(e)
    }
    const handleInputChange = (e) => {

        const {id , value} = e.target;

        if(id === "firstName"){
            console.log(value)
            setFirstName(value);
        }
        if(id === "lastName"){
            setLastName(value);
        }
        if(id === "email"){
            setEmail(value);
        }
        if(id === "password"){
            setPassword(value);
        }
        if(id === "confirmPassword"){
            setConfirmPassword(value);
        }
        if(id === "phoneNumber"){
            setPhoneNumber(value);
        }
        if(id === "userType"){
            setUserType(value);
        }
        if(id === "description"){
            setDescription(value);
        }

    }

    const handleSubmit  = () => {

        console.log()
        console.log(firstName,lastName,email,password,confirmPassword,phoneNumber,country.label,userType,description,foundation,gender,skills);

        const data={full_name:`${firstName} ${lastName}`,email:email,password:password,
        phone_number:phoneNumber,country:country,user_type:userType,description:description,
        foundation:foundation,gender:gender,skills:skills}
        fetch('http://localhost:8081/api/registration', {
            // headers:{ "Access-Control-Allow-Origin": "*"},    
            method: 'POST',
            body: JSON.stringify(data),
          })
          .then(response => response.json())
          .then(data => {
            if (data.error){
              alert(`Error`);
            }
            else 
              alert(`successfully created user: ${data.id}`);

          })
          .catch((error) => {
            alert(`${error} - Error`);
          });
        }

    const options = useMemo(() => countryList().getData(), [])

    return(
        <div className="form">
            <div className="form-body">
                <div className="username">
                    <label className="form__label" htmlFor="firstName">First Name </label>
                    <input className="form__input" type="text" value={firstName} onChange = {(e) => handleInputChange(e)} id="firstName" placeholder="First Name"/>
                </div>
                <div className="lastname">
                    <label className="form__label" htmlFor="lastName">Last Name </label>
                    <input  type="text" name="" id="lastName" value={lastName}  className="form__input" onChange = {(e) => handleInputChange(e)} placeholder="LastName"/>
                </div>
                <div className="email">
                    <label className="form__label" htmlFor="email">Email </label>
                    <input  type="email" id="email" className="form__input" value={email} onChange = {(e) => handleInputChange(e)} placeholder="Email"/>
                </div>
                <div className="phoneNumber">
                    <label className="form__label" htmlFor="phoneNumber">Phone number </label>
                    <input  type="text" id="phoneNumber" className="form__input" value={phoneNumber} onChange = {(e) => handleInputChange(e)} placeholder="phoneNumber"/>
                </div>
                <div className="country">
                    <label className="form__label" htmlFor="country">Country </label>
                    <Select id="country" className="form__select" options={options} value={country} onChange={(e) => handleSelectChange(e)} />
                </div>
                <div className="userType">
                    <label className="form__label" htmlFor="userType">User Type </label>
                    <input  type="text" id="userType" className="form__input" value={userType} onChange = {(e) => handleInputChange(e)} placeholder="userType"/>
                </div>
                <div className="description">
                    <label className="form__label" htmlFor="description">Description </label>
                    <input  type="text" id="description" className="form__input" value={description} onChange = {(e) => handleInputChange(e)} placeholder="description"/>
                </div>
                <div className="password">
                    <label className="form__label" htmlFor="password">Password </label>
                    <input className="form__input" type="password"  id="password" value={password} onChange = {(e) => handleInputChange(e)} placeholder="Password"/>
                </div>
                <div className="confirm-password">
                    <label className="form__label" htmlFor="confirmPassword">Confirm Password </label>
                    <input className="form__input" type="password" id="confirmPassword" value={confirmPassword} onChange = {(e) => handleInputChange(e)} placeholder="Confirm Password"/>
                </div>
            </div>
            <div className="footer">
                <button onClick={()=>handleSubmit()} type="submit" className="btn">Register</button>
            </div>
        </div>

    )       
}

export default RegistrationForm
